#include <stdio.h>#include <iostream>#include <algorithm>using namespace std;const int N = 1000100;int a[N];int main(){    int n,k,num,temp,i,j;    char ch;    while(scanf("%d%d",&n,&k) == 2)    {        int cnt = 1;        memset(a,0,sizeof(a));        for(i=0 ; i < n ; ++i){            scanf(" %c",&ch);            if(ch=='I'){                scanf("%d",&num);                if(num < a[k-1]) continue;                temp = cnt;                for(j=0 ; j < cnt ; ++j){                    if(a[j] < num){                        temp = j; break;                    }                }                cnt++;                for(j=cnt-1 ; j > temp ; --j)                    a[j] = a[j-1];                a[temp] = num;            } else if(ch=='Q'){                printf("%d\n",a[k-1]);            }        }    }    return 0;}